@W E E B That's the thing, I could very easily have fully enjoyed it but the artist went out his way to make it less enjoyable with the jarring dialogue that kind of leans on the 4th wall. 

@what_are_you_crying NTR is short for Netorare. It's hentai where there's usually a healthy couple at the beginning and someone comes along and steals one of them  away. 

@Fuck_Buckets But if you're one of the lonely ass losers don't you want to imagine yourself someone in a bit better of a situation? There's a lot of vanilla or wholesome hentai protagonists I'd rather live vicariously through.
